import React, { Component } from 'react';
import axios from 'axios';

export class Contact extends Component {
    constructor(){
        super();
        this.state = {
            admins: []
        }
    }
    componentDidMount(){
        axios.get('/api/admins').then(response => {
            this.setState({ 
                admins: response.data
            })
        })
    }
  render() {
    return (
      <div>
        Contact
      </div>
    )
  }
}

export default Contact
